import React from 'react';
import { createDrawerNavigator } from '@react-navigation/drawer';
import HomeScreen from '../../../screens/home/HomeScreen';
import FazerSolicitacaoScreen from '../../../screens/solicitacao/fazerSolicitacao/FazerSolicitacaoScreen';
import { FazerSolicitacaoProvider } from '../../../context/FazerSolicitacaoContext';
import ListarSolicitacaoScreen from '../../../screens/solicitacao/listarSolicitacao/ListarSolicitacaoScreen';

const Drawer = createDrawerNavigator();

const SideMenuScreen = () => {
    return (
        <FazerSolicitacaoProvider>
            <Drawer.Navigator
                initialRouteName="Solicitações"
            >
                <Drawer.Screen name="Home" component={HomeScreen} />
                <Drawer.Screen name="Fazer Solicitação" component={FazerSolicitacaoScreen} />
                <Drawer.Screen name="Solicitações" component={ListarSolicitacaoScreen} />
                <Drawer.Screen name="Mensagens" component={FazerSolicitacaoScreen} />
            </Drawer.Navigator>
        </FazerSolicitacaoProvider>
    );
}

export default SideMenuScreen;
